// src/components/Technologies.js

import React from 'react';

// Importing SVG icons
import html5Icon from '../assets/html5-color.svg';
import css3Icon from '../assets/css3-color.svg';
import jsIcon from '../assets/javascript-color.svg';
import reactIcon from '../assets/react-color.svg';
import nodejsIcon from '../assets/nodejs-icon.svg';
import mongodbIcon from '../assets/mongodb-icon.svg';
import expressIcon from '../assets/express-icon.svg';
import mongooseIcon from '../assets/mongoose-icon.svg';
import graphqlIcon from '../assets/graphql-icon.svg';
import apolloClientIcon from '../assets/apollo-client-icon.svg';
import jwtIcon from '../assets/jwt-icon.svg';
import tailwindcssIcon from '../assets/tailwindcss-icon.svg';
import bootstrapIcon from '../assets/bootstrap-icon.svg';
import reactRouterDomIcon from '../assets/react-router-dom-icon.svg';
import reduxIcon from '../assets/redux-icon.svg';
import sequelizeIcon from '../assets/sequelize-icon.svg';
import handlebarsIcon from '../assets/handlebars-icon.svg';
import herokuIcon from '../assets/heroku-icon.svg';
import githubIcon from '../assets/github-icon.svg';
import apolloServerIcon from '../assets/apollo-server-icon.svg';
import cloudinaryIcon from '../assets/cloudinary-icon.svg';
import axiosIcon from '../assets/axios-icon.svg';
import d3jsIcon from '../assets/d3js-icon.svg';
import nextjsIcon from '../assets/nextjs-icon.svg';
import firebaseIcon from '../assets/firebase-icon.svg';
import chakraUiIcon from '../assets/chakra-ui-icon.svg';
import dockerIcon from '../assets/docker-icon.svg';
import renderIcon from '../assets/render-icon.svg';
import sassIcon from '../assets/sass-icon.svg';

const mainTechnologies = [
  { name: 'HTML5', icon: html5Icon },
  { name: 'CSS3', icon: css3Icon },
  { name: 'JavaScript', icon: jsIcon },
  { name: 'React', icon: reactIcon },
  { name: 'Node.js', icon: nodejsIcon },
  { name: 'MongoDB', icon: mongodbIcon },
];

const smallerTechnologies = [
  { name: 'Express.js', icon: expressIcon },
  { name: 'Mongoose', icon: mongooseIcon },
  { name: 'GraphQL', icon: graphqlIcon },
  { name: 'Apollo Client', icon: apolloClientIcon },
  { name: 'JWT', icon: jwtIcon },
  { name: 'Tailwind CSS', icon: tailwindcssIcon },
  { name: 'Bootstrap', icon: bootstrapIcon },
  { name: 'React Router DOM', icon: reactRouterDomIcon },
  { name: 'Redux', icon: reduxIcon },
  { name: 'Sequelize', icon: sequelizeIcon },
  { name: 'Handlebars.js', icon: handlebarsIcon },
  { name: 'Heroku', icon: herokuIcon },
  { name: 'GitHub', icon: githubIcon },
  { name: 'Apollo Server', icon: apolloServerIcon },
  { name: 'Cloudinary', icon: cloudinaryIcon },
  { name: 'Axios', icon: axiosIcon },
  { name: 'D3.js', icon: d3jsIcon },
  { name: 'Next.js', icon: nextjsIcon },
  { name: 'Firebase', icon: firebaseIcon },
  { name: 'Chakra UI', icon: chakraUiIcon },
  { name: 'Docker', icon: dockerIcon },
  { name: 'Render', icon: renderIcon },
  { name: 'Sass', icon: sassIcon },
];

const Technologies = () => {
  return (
    <section className="bg-gray-900 py-16" id="technologies">
      <div className="container mx-auto px-4">
        <h2 className="text-4xl font-bold text-center text-white mb-8">Technologies</h2>

        <h3 className="text-2xl font-bold text-white mb-4">Main Technologies</h3>
        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-6 gap-8 mb-8">
          {mainTechnologies.map((tech) => (
            <div key={tech.name} className="flex flex-col items-center">
              <img src={tech.icon} alt={tech.name} className="h-20 mb-4" />
              <p className="text-white">{tech.name}</p>
            </div>
          ))}
        </div>

        <h3 className="text-2xl font-bold text-white mb-4">Other Technologies</h3>
        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-6 gap-8">
          {smallerTechnologies.map((tech) => (
            <div key={tech.name} className="flex flex-col items-center">
              <img src={tech.icon} alt={tech.name} className="h-12 mb-2" />
              <p className="text-white text-sm">{tech.name}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Technologies;
